import Header from "../component/Header/Header";
import Main from "../component/Main/Main";
import Sidebar from "../component/Sidebar/Sidebar";

const Home = () => {
    return (
        <div className="home">
            <Header />
            <div className="container">
                <Sidebar />
                <Main />
            </div>
        </div>
    );
};

export default Home;
